export default {
  state: {},
  mutations: {},
  actions: {
    authUser({ commit }, authData) {
      const key = "AIzaSyAOyTrULzGd7rbuhaDsFWIMR4V6hmdWV3A";
      return fetch.post(
        "https://identitytoolkit.googleapis.com/v1/accounts:signUp?key=[API_KEY]"
      );
    },
  },
  getters: {},
};
